import React from 'react';
import { Link } from 'react-router-dom';
import './Card.css';

const Card = ({pokemon})=>{

    console.log(pokemon.sprites.other.dream_world.fron_default)
    return(
        <div className='CDcard'>
            <Link to={`/card/${pokemon.id}`} className='CDLink'>
                <div className='CDfigure'>
                    <img src= {pokemon.sprites.other.dream_world.front_default} alt='name' className='CDimgs'/>
                    <div className='CDcardText'>
                        <h2>{pokemon.name}</h2>
                        {/* <h3>Type: {pokemon.types.map(t => {t.type.name})}</h3> */}
                    </div>
                </div>          
            </Link>
        </div>
    )
}

export default Card;
